    axios.post('http://localhost:3333/register', {
      username: "Manu",
      password: "password2"
    })
    .then((response) => {
      <p>{response.data}</p>
    }
    )
  };
  return (
    <div>
      <button onClick={submit}>Send POST Request</button>
      <p>The response is</p>
    </div>
  )
}
